  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  JMACLEAN, Margaret Elizabeth and CURRIE, George William
  JCURRIE, Joyce Bertha Earle and SHERRIFF, Dudley Albert
  ISHERRIFF, Laurence Patrick (Paddy) and TULLOCH, Jessie Mary
  03> SHERRIFF, Sallie Joyce
  b 19.12.1974
  Sallie b. at Masterton. She attended primary school in Masterton then went to St Matthew's
  College, Masterton for five years before attending Otago University in 1993-96. She graduated
  BCom and is now working for the Christchurch City Council.
  05> SHERRIFF, Margot Elizabeth m on 09.05.1975 to WILLOCK, Patrick David
  b 14.01.1949
  b 28.11.1949
  Margot b. at Gisborne and m. at Tolaga Bay. Patrick, slo Peter Reginald Willock and Pamela Mary
  Chrisp, b. at Gisborne. Address: Waiomoko Road, RD 3, Whangara, Gisborne.
  Margot was educated at Tolaga Bay School and Nga Tawa in Marton. She worked for the Gisborne Vet
  Club for three years after leaving school, then went overseas for three years. After her return
  she worked as a hotel receptionist in Gisborne and Masterton until her marriage.
  Patrick was educated at Mangapapa Primary School, Ilminster Intermediate in Gisborne and Wanganui
  Collegiate School. He worked on farms around Gisborne and in 1970-71 he went to Massey University
  to gain a Diploma in Sheepfarming. He spent several months overseas before returning to the family
  farm. He has been a Gisborne District Councillor (Uawa Ward) since 1989 and Provincial President
  of Federated Farmers (1995-98).
  01> WILLOCK, Nicola Jane
  b 08.03.1979
  Nicola b. at Gisborne. She was educated at Whangara Primary School, Gisborne Intermediate and
  Gisborne Girls' High School then spent 1996 in Thailand as an AFS exchange student. In 1997
  she completed a Travel and Tourism Diploma in Christchurch.
  02> WILLOCK, Deborah Margot
  b 24.12.1981
  Deborah b. at Lower Hutt. She was educated at Whangara Primary School and Ilminster
  Intermediate and is now at Gisborne Girls' High School.
  3> WILLOCK, William Patrick
  b 13.04.1983
  William b. at Gisborne. He was educated at Whangara Primary School and Ilminster Intermediate
  and is now at Gisborne Boys' High School,
  04> WILLOCK, Paddy Sherriff
  b 01.10.1985
  Paddy b. at Gisborne. He was educated at Whangara Primary School and is now at Ilminster
  Intermediate.
  04>'CURRIE, Robert George Manson m on 18.02.1950 to (1) POWER, Marie Willamere
  (Robin)
  b 18.01.1918 d 30.05.1986
  b 28.01.1918 d 26.04.1969
  Robin b. at Wanganui and d. at Wellington.
  b1> CURRIE, Elizabeth Anne m on 26.07.1975 to BURTON, Robert William
  b 29.12.1953
  b 07.04.1948
  Anne b. and m. at Wellington, Robert, s/o Robert Burton and Doris Sanders, b. at Harwich, England.
  Address: 2 Stroud Way, Newlands, Wellington,
  Anne is involved in the publishing of local newspapers and Robert is a storeman.
